import React, {Component} from 'react';

class Login extends Component {
    render () {
      return (
        <div className="App">
            <segment className="BackColor">
                <h4>Nombre completo</h4>
                <input type="text"/>
                <h4>Edad</h4>
                <input type="text"/>
            </segment>
        </div>
      )
    }
  }
   
  export default Login
